%cassandra

SELECT * FROM spark_demo.performers 
WHERE solr_query='{"q":"name:*","facet":{"query":"country:{{Country=USA}} AND styles:*{{Style=Rock}}*"}}';

%cassandra
USE spark_demo;

SELECT * FROM performers 
WHERE solr_query='{"q":"*","facet":{"field":"country"}}';

%cassandra

SELECT title,performer,year FROM spark_demo.albums
WHERE solr_query='country:Germany';
